          if (copyStudent.id === grade.studentId) {
            copyStudent.grade = grade.grade;
          } else if (!copyStudent.grade) {
            copyStudent.grade = 'N/A';
          }
          return copyStudent;
        });
      }
      return updateStudent;
    });
  return result;
}

